import Header from "./Header"

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: "1px solid #DDD"
}
type Props = {
    props: any[]
}

function Layout({props}: Props) {

    return (
        <div style={layoutStyle}>
            <Header />
            {props.children}
        </div>
    )
}

export default Layout
